gPC(){return"Anwendungen f\xfcr das Android OS"},
gPD(){return"Android ist ein modernes Betriebssystem f\xfcr mobile Endger\xe4te und wird von der Open Handset Alliance entwickelt. Es basiert auf dem Linux-Betriebssystem, Anwendungen (Apps) werden in der Java-Programmiersprache erstellt. Android hat seit seinem Erscheinen Anfang 2009 einen riesigen Marjkt erschlossen und ist heute auf Smartphones, Mobiltelefonen, Netbooks und Tablet-PCs zuhause.Wir entwickeln Anwendungen f\xfcr das Android OS oder portieren Ihre vorhandenen Anwendungen von anderen Plattformen nach Android."},
