gR0(){return"In unseren Projekten setzen wir vorwiegend Java als Programmiersprache ein und nutzen Java-Programmierbibliotheken und -Standards. So bieten wir Entwicklung von\n- Anwendungen auf Basis von Java Swing und Eclipse RCP\n- Client- und Serverkomponenten f\xfcr Web Services\n- Webanwendungen auf Basis des Google Web Toolkit (GWT)\n\nPartMaster wendet bei der Anwendungsentwicklung konsequent agile Methodiken an, so k\xf6nnen Sie als Kunde den Entwicklungsprozess kontinuierlich begleiten und mit gestalten. Sie erhalten fr\xfchzeitig erste Software-Versionen, die Sie an Ihren Anforderungen pr\xfcfen und den weiteren Entwicklungsprozess steuern k\xf6nnen. Sie wird gew\xe4hrleistet, dass Sie am Fertigstellungstermin genau die Software erhalten, die Ihre Anforderungen bestm\xf6glich abdeckt und Ihre Erwartungen optimal erf\xfcllt."},
