gVT(){return"Android, das Betriebssystem f\xfcr mobile Endger\xe4te, hat sich in den 2 Jahren seit seinem Erscheinen zu einer sehr beliebten Software-Entwicklungsplattform entwickelt. Entwicklern bietet sich mit dieser Entwicklungsplattform eine der fortschrittlichsten Softwarearchitekturen mit m\xe4chtigen Entwicklerwerkzeugen und etablierten Distributionskan\xe4len."},
gVU(){return'Training "Anwendungsentwicklung mit Eclipse RCP"'},
gVV(){return'Eclipse ist unser Mittel der Wahl bei der Entwicklung von Desktop-Anwendungen. So setzen wir seit sechs Jahren die Eclipse Rich Client Platform als Basis der Anwendungsentwicklung ein.In dem Training "Anwendungsentwicklung mit Eclipse RCP" werden den Teilnehmern alle notwendigen Kenntnisse zum Entwickeln von erweiterbaren, komponentenbasierten Anwendungen auf Basis der Eclipse Rich Client Platform. Wir bieten zwei je zweit\xe4gige Kurse an, die auch gemeinsam gebucht werden k\xf6nnen.'},
gDy(){return"Wir entwickeln <em>IT-Strategien</em>, erarbeiten <em>Kriterien</em> f\xfcr den Einsatz und die Auswahl von Technologien und Produkten, erstellen <em>Softwarekomponenten</em> und integrieren diese in bestehende <em>IT-Architekturen</em>. Als kleines, technologieorientiertes Unternehmen \xfcbernehmen wir f\xfcr unsere Kunden die Rolle des <em>Gestalters, Vermittlers und Br\xfcckenbauers</em> um Chancen f\xfcr unsere Kunden nutzbar zu machen, die sich durch neue Technologien bieten.\n\nUnser Ziel ist es, die abzuwickelnden Vorg\xe4nge des Kunden optimal durch eine <em>intuitiv bedienbare Software</em> zu begleiten und dabei die <em>Kreativit\xe4t</em>, die <em>Individualit\xe4t</em> und die M\xf6glichkeiten der <em>Selbstorganisation</em> der Mitarbeiter nicht einzuschr\xe4nken, sondern zu erweitern. Durchgef\xfchrte Arbeiten m\xfcnden <em>schnell</em> in <em>konkreten Ergebnissen</em>, was f\xfcr den Kunden <em>Planungssicherheit</em> und <em>Investitionssicherheit</em> gew\xe4hrleistet.\n\nPartmaster GmbH wird von <em>MORE Invest</em> unterst\xfctzt und finanziert, ein Unternehmen der <em>Innoveas Gruppe</em>."},
gPH(){return"Die Anreise mit dem PKW ist nat\xfcrlich aus verschiedenen Richtungen m\xf6glich. In unmittelbarere N\xe4he unserer B\xfcror\xe4ume befindet sich das City-Parkhaus in der Langen Stra\xdfe, in dem Sie Ihr Auto bequem abstellen k\xf6nnen. Aus dem Parkhaus kommend, wenden Sie sich bitte nach rechts, gehen einige Meter geradeaus und biegen nach links in die Lagerstra\xdfe ein. Der Eingang zu unseren B\xfcros befindet sich gleich hier im Hofbereich."},
gPJ(){return"Vom Rostocker Hauptbahnhof kommen Sie direkt mit der Stra\xdfenbahn in die Innenstadt. Hier benutzen Sie die Bahnen in Richtung City. An der Haltestelle 'Neuer Markt' steigen Sie aus und folgen dem Verlauf der Stra\xdfenbahnschienen, vorbei an der Marienkirche. An der n\xe4chsten Ampel \xfcberqueren Sie die Stra\xdfenbahnschienen ('Lange Stra\xdfe'). Folgen Sie dann dem Verlauf der Langen Stra\xdfe einige Meter bis Sie rechts einen gro\xdfen Torbogen-Eingang sehen. Diesen Eingang gehen sie hindurch, die Treppe hinunter und wenden sich nach rechts. Sie gehen etwa 10 Meter geradeaus und biegen dann wieder links ab. Hier \xfcber diesen Innenhof erreichen Sie unsere B\xfcros."},
