gR6(){return'Diese Website nutzt Funktionen des  Webanalysedienstes Google Analytics. Anbieter ist die Google Inc. 1600 Amphitheatre Parkway Mountain View, CA 94043, USA. Google Analytics verwendet sog. "Cookies". Das sind Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie erm\xf6glichen. Die durch den Cookie erzeugten Informationen \xfcber Ihre Benutzung dieser Website werden in der Regel an einen Server von Google in den USA \xfcbertragen und dort gespeichert.\n\nIm Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ\xe4ischen Union oder in anderen Vertragsstaaten des Abkommens \xfcber den Europ\xe4ischen Wirtschaftsraum zuvor gek\xfcrzt. Nur in Ausnahmef\xe4llen wird die volle IP-Adresse an einen Server von Google in den USA \xfcbertragen und dort gek\xfcrzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports \xfcber die Websiteaktivit\xe4ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen\xfcber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Ihrem Browser \xfcbermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef\xfchrt.\n\nSie k\xf6nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s\xe4mtliche Funktionen dieser Website vollumf\xe4nglich werden nutzen k\xf6nnen. Sie k\xf6nnen dar\xfcber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem sie das unter dem folgenden Link verf\xfcgbare Browser-Plugin herunterladen und installieren: http://tools.google.com/dlpage/gaoptout?hl=de\n\nErstellt unter Verwendung des Generators f\xfcr Datenschutzerkl\xe4rungen auf e-recht24.de'},
