gPD(){return"Android is a modern operating system for mobile devices and is being developed by the Open Handset Alliance. It is based on the Linux operating system, applications (apps) are created in the Java programming language. Android has opened up a huge market since its appearance in early 2009 and is now found on smartphones, mobile phones, netbooks and tablet PCs. We develop applications for the Android OS or port your existing applications from other platforms to Android."},
