gHk(){return"The operators of these pages take the protection of your personal data very seriously. We treat your personal data confidentially and in accordance with the statutory data protection regulations and this data protection declaration."},
gU3(){return"Name and address of the responsible person:"},
gU4(){return"The person responsible within the meaning of the General Data Protection Regulation and other national data protection laws of the member states as well as other data protection regulations is:\n\nPartMaster GmbH\nSteffen Nowacki\nLagerstra\xdfe 44/45\n18055 Rostock\n\nTelephone: +49 381-20373995\nE-Mail : info@partmaster.de\nWebsite: https://www.partmaster.de"},
gUR(){return"In principle, we only process the personal data of our users to the extent that this is necessary to provide a functional website and our content and services. The processing of personal data of our users takes place regularly only with the consent of the user. An exception applies in such cases in which it is not possible to obtain prior consent for actual reasons and the processing of the data is permitted by statutory provisions.\n\nOur website can usually be used without providing personal data. Insofar as personal data (e.g. name, address or e-mail addresses) is collected on our website, this is always done on a voluntary basis as far as possible. This data will not be passed on to third parties without your express consent.\n\nWe would like to point out that data transmission on the Internet (e.g. when communicating by e-mail) can have security gaps. A complete protection of the data against access by third parties is not possible."},
gIC(){return"SSL-Encryption"},
gID(){return'For security reasons and to protect the transmission of confidential content, such as the inquiries you send to us as the site operator, this site uses SSL encryption. You can recognize an encrypted connection by the fact that the address line of the browser changes from "http://" to "https://" and by the lock symbol in your browser line.\n\nIf SSL encryption is activated, the data that you transmit to us cannot be read by third parties.'},
gVy(){return"Right to information, deletion, blocking"},
gVz(){return"You have the right to free information about your stored personal data, its origin and recipient and the purpose of the data processing as well as a right to correction, blocking or deletion of this data at any time. You can contact us at any time at the address given in the imprint if you have any further questions on the subject of personal data."},
gR3(){return"Data collection on our website"},
gR4(){return'Cookies\n\nSome of the websites use so-called cookies. Cookies do not damage your computer and do not contain viruses. Cookies serve to make our offer more user-friendly, effective and secure. Cookies are small text files that are stored on your computer and saved by your browser.\n\nMost of the cookies we use are so-called "session cookies". They are automatically deleted at the end of your visit. Other cookies remain stored on your end device until you delete them.These cookies enable us to recognize your browser on your next visit.\n\nYou can set your browser so that you are informed about the setting of cookies and only allow cookies in individual cases, acceptance exclude cookies for certain cases or in general and activate the automatic deletion of cookies when closing the browser.If cookies are deactivated, the functionality of this website may be restricted.\nServer log files\n\nThe provider of the pages collects and saves automatically Information in so-called server log files, which your browser automatically transmits to us.These are:\n\n Browser type and Browser version\n Operating system used\n Referrer URL\n Host name of the accessing computer\n Time of server request\n IP address\n\nThis data cannot be assigned to specific individuals. This data is not merged with other data sources. We reserve the right to subsequently check this data if we become aware of specific indications of illegal use. The data will be deleted after seven days.\nContact form\n\nIf you send us inquiries via the contact form, your details from the inquiry form, including the contact details you provided there, will be stored by us for the purpose of processing the inquiry and in the event of follow-up questions. We do not pass on this data without your consent.\n\nThe processing of the data entered in the contact form is therefore exclusively based on your consent (Art. 6 Para. 1 lit. a DSGVO). You can revoke this consent at any time. An informal message by e-mail to us is sufficient. The legality of the data processing operations that took place up to the point of revocation remains unaffected by the revocation.\n\nThe data you enter in the contact form will remain with us until you request deletion, revoke your consent to storage or the purpose for data storage no longer applies (e.g. after completion of the processing your request). Mandatory legal provisions - in particular retention periods - remain unaffected.'},
gR5(){return"Data protection declaration for the use of Google Analytics"},
gR6(){return'This website uses functions of the web analysis service Google Analytics. The provider is Google Inc. 1600 Amphitheater Parkway Mountain View, CA 94043, USA. Google Analytics uses so-called "cookies". These are text files that are stored on your computer and that enable an analysis of your use of the website. The information generated by the cookie about your use of this website is usually transmitted to a Google server in the USA and stored there.\n\nIf IP anonymization is activated on this website, however, your IP address will be saved by Google shortened beforehand within member states of the European Union or in other contracting states of the Agreement on the European Economic Area. Only in exceptional cases will the full IP address be sent to a Google server in the USA and shortened there. On behalf of the operator of this website, Google will use this information to evaluate your use of the website, to compile reports on website activity and to provide other services related to website activity and internet usage to the website operator. The IP address transmitted by your browser as part of Google Analytics will not be merged with other Google data.\n\nYou can prevent the storage of cookies by setting your browser software accordingly; we would like to point out to you however that in this case you will if applicable not be able to use all functions of this website in full. You can also prevent Google from collecting the data generated by the cookie and related to your use of the website (including your IP address) and from processing this data by Google by downloading the browser plug-in available under the following link and install: http://tools.google.com/dlpage/gaoptout?hl=de\n\nCreated using the generator for data protection declarations on e-recht24.de'},
